    false,nt"url": null,nt"notes": "Floodplain restoration plans for the Leota
    bottoms at the Ouray National Wildlife Refuge. This plan is submitted to obtain
    support for funding assistance through the Recovery Implementation Program for the
    Endangered Fishes of the Upper Colc,rado River Basin. The basic plan is to increase
    the frequency of natural inundation to benefit endangered fishes and native riparian
    vegetation. It is proposed that the lower unit of Leota Ponds (odd numbered ponds,
    except L-9) on the Ouray National Wildlife Refuge be managed primarily to restore
    endangered fishes and maintain natural riparian vegetation (figure 2). The fundamental
    plan would include increasing the height of the existing dike between the four ponds
    adjacent to the river from the even numbered ponds (including L-9).",nt"owner_org":
